var YM137 ="Notez que certaines de ces options peuvent interagir avec dautres restrictions de ports. Le filtrage indépendant de point d'extrémité a la priorité sur les filtres entrants ou les programmations. En conséquence, il est possible quune demande de session entrante liée à une session sortante entre via un port en dépit dun filtre entrant actif sur ce port. Cependant, les paquets seront rejetés comme prévu s'ils sont envoyés vers des ports bloqués (que ces ports soient bloqués par une programmation ou par un filtre entrant) pour lesquels il nexiste pas de session active. Avec le filtrage restreint de port et dadresse, les filtres entrants et les programmations fonctionnent de façon précise mais empêchent un certain niveau de connectivité. Ce filtrage peut donc nécessiter lutilisation de déclencheurs de ports, de serveurs virtuels ou de redirection de port afin d'ouvrir les ports nécessaires à lapplication. Le filtrage restreint dadresse offre un compromis qui évite les problèmes lors de la communication avec certains autres types de routeurs NAT (routeurs NAT symétriques en particulier) mais laisse les filtres entrants et laccès programmé fonctionner comme prévu.";
