var help57 =" Des connexions multiples sont exigées par certaines applications, telles que des jeux sur Internet, la vidéo conférence, la téléphonie sur Internet, et d’autres. Ces applications ont des difficultés à fonctionner à travers NAT (Traduction d'adresses de réseau). Cette section est utilisée pour ouvrir de multiples ports ou une plage de ports sur votre routeur et pour rediriger les données passant par ces ports vers une machine de votre réseau. Vous pouvez saisir des ports dans divers formats :";
var help63 =" Supposez que vous hébergez un serveur de jeu en ligne qui fonctionne sur un PC avec une adresse IP privée 192.168.0.50. Ce jeu demande que vous ouvriez les ports suivants (6159-6180, 99) sur le routeur afin de permettre aux utilisateurs d'Internet de s’y connecter.";
