var help79 =" Cette option est activée par défaut de sorte que votre routeur puisse déterminer automatiquement quels programmes doivent avoir la priorité du réseau.";
var help80 =" Cette option devrait être activée si le débit montant vers Internet est lent. Elle aide à réduire l'impact que peuvent avoir des grands paquets à priorité faible sur les plus urgents en fragmentant les grands paquets en plusieurs plus petits.";
var help81 ="Lorsqu’elle est activée, cette option oblige le routeur à mesurer automatiquement la bande passante utile en liaison montante chaque fois que l'interface du réseau étendu est rétablie (par exemple après une réinitialisation).";
var help82 ="Il s'agit de la vitesse de liaison montante mesurée lorsque l'interface du réseau étendu a été rétablie pour la dernière fois. Sa valeur peut être inférieure à celle annoncée par votre FAI, car elle n'inclut pas tous les temps système des protocoles associés au réseau de votre FAI. Généralement, cette valeur est comprise entre 87 % et 91 % de la vitesse de liaison montante définie pour les connexions xDSL, et est inférieure d’environ 5 kbits/s pour les connexions par câble.";
var help83 =" Si la vitesse automatique de liaison montante est désactivée, cette option vous permet de la régler manuellement. La vitesse de liaison montante est la vitesse à laquelle des données peuvent être transférées à partir du routeur vers votre FAI (Fournisseur d’Accès à Internet). Ceci est déterminé par votre FAI. La vitesse est souvent la indiquée comme une paire de liaison descendante/liaison montante ; par exemple, 1.5Mbps/284kbps. En suivant cet exemple, vous devrez saisir \"284\". Vous pouvez aussi examiner la vitesse de liaison montante à l’aide d’un service comme <a href=\"http://www.dslreports.com\">www.dslreports.com</a>. Notez cependant que les sites tel DSL Reports, parce qu'ils ne gèrent pas tous les protocoles réseau, indiqueront généralement des vitesses légèrement inférieures à la vitesse mesurée réelle ou à la vitesse indiquée par le FAI.";
var help84 =" Par défaut, le routeur examine automatiquement si la connexion est en réseau xDSL/Relais de trames ou un autre type (tel que le modem câble ou l'Ethernet), et il montre le résultat comme <span class=\"option\"> xDSL ou Relais de trames réseau</span>. Si votre connexion à Internet est xDSL mais avec une configuration IP WAN est \"Statique\" ou le \"DHCP\", réglez cette option dans<span class=\"option\"> xDSL ou Rélais de trames réseau </span> afin que le routeur puisse se connecter correctement et donner les meilleures performances. Sélectionnez <span class=\"option\">xDSL ou Relais de trames réseau</span> implique que la vitesse mesurée de liaison montante peut être légèrement plus lente que la connexion antérieure, mais qu’elle donne de meilleurs résultats.";
var help85 =" Détection xDSL ou Relais de trames réseau";
