var help117 =" La section de contrôle d'accès vous permet de contrôler l'accès entrant et sortant des machines de votre réseau. Utilisez ce moyen comme Contrôle Parental pour accorder seulement l'accès aux sites approuvés, limiter l'accès du Web en fonction de l'heure ou de la date, et/ou l'accès des applications telles que des utilitaires peer-2-peer ou des jeux.";
var help118 =" Par défaut, le dispositif de contrôle d'accès est désactivé. Si vous avez besoin du contrôle d'accès, vérifiez cette option.";
var help119 =" Remarque:";
var help120 =" Quand le contrôle d'accès est désactivé, chaque machine sur le réseau local a un accès sans restriction à Internet. Cependant, si vous activez le contrôle d'accès, l'accès à Internet est restreint pour les machines à qui s’applique ce contrôle d'accès. Toutes les autres machines ont un accès sans restriction à Internet.";
