var haf_intro_1 =" Le routeur fournit un coupe-feu étanche en vertu des fonctionnements de NAT. Tant que vous ne configurez pas le routeur autrement, le NAT ne répond pas aux demandes non sollicitées entrantes quelque que soit le port, rendant votre réseau local invisible des cyberattaques d'Internet. Cependant, quelques applications de réseau ne peuvent pas fonctionner avec un coupe-feu étanche. Ces applications doivent ouvrir sélectivement des ports dans le coupe-feu pour fonctionner correctement. Les options sur cette page contrôlent plusieurs façons d’ouvrir le coupe-feu pour satisfaire les besoins spécifiques de ses applications.";
var help164_1 =" Quand le protocole est TCP, SPI vérifie que les numéros d’ordre des paquets sont dans la plage valide pour la session, jetant les paquets qui n'ont pas de numéro d'ordre valide.";
var help164_2 =" Que le SPI soit validé ou non, le routeur contrôle toujours l’état des connexions TCP et s'assure que les drapeaux de chaque paquet TCP sont valides pour l'état correspondant.";
var haf_dmz_10 =" Quand un hôte du réseau local est configuré comme un hôte DMZ, il devient la destination pour tous les paquets entrants qui ne correspondent pas à d’autres sessions ou règles entrantes. Si n'importe quelle autre règle d'entrée existe, elle sera employée au lieu d’envoyer les paquets sur l’hôte DMZ; ainsi, une session active, un Serveur Virtuel, un port de déclenchement actif, ou une règle de réacheminement de port auront la priorité sur l’hôte DMZ. (La politique de DMZ ressemble à une règle de réacheminement de port par défaut qui réachemine chaque port qui n'est pas spécifiquement envoyé à un aure endroit )";
var haf_dmz_20 =" Le routeur ne fournit qu’une protection limitée de coupe-feu pour l’hôte DMZ. Le routeur ne réachemine pas un paquet TCP qui ne correspond pas à une session DMZ active, à moins que ce soit un paquet d'établissement de connexion (Caractère de synchronisation SYN). Excepté cette protection limitée de l’hôte DMZ, il est effectivement \"en dehors du coupe-feu\". Toute personne voulant  employer un hôte DMZ devrait également activer dessus un parefeu pour assurer une protection supplémentaire.";
var haf_dmz_30 =" Les paquets reçus par l’hôte DMZ ont leurs adresses IP traduites de l'adresse IP WAN du routeur vers l'adresse IP LAN de l’hôte DMZ. Cependant, les numéros de port ne sont pas traduits; ainsi les applications sur l’hôte DMZ peuvent continuer d’utiliser leurs numéros de port spécifiques.";
var haf_dmz_40 =" La fonction DMZ est juste un des moyens pour autoriser les demandes entrantes que le NAT refuserait. En général l’hôte DMZ ne doit être utilisé que s'il n'y a aucune autre solution de rechange, parce qu'il est exposé aux cyberattaques beaucoup plus que les autres systèmes sur le réseau local. Il faut d’abord penser à employer d’autres configurations telles : un Serveur Virtuel, une règle de réacheminement de port, ou un port de déclenchement. Les serveurs virtuels ouvrent un port pour des sessions entrantes restreintes à une application spécifique (et permet également la réorientation de ports et l'utilisation des ALGs). Le réacheminement de port est plutôt un DMZ sélectif, où le trafic entrant d’un ou plusieurs ports est réacheminé à un hôte LAN spécifique (donc moins de ports sont exposés comparé à un hôte DMZ). Port de déclenchement est une forme spéciale de réacheminement de port, qui est activé par le trafic sortant, et pour lequel les ports ne sont réacheminés que lorsque le déclenchement est actif.";
var haf_dmz_50 =" Peu d'applications exigent vraiment l'utilisation d’un hôte DMZ. Voir ci-dessous des exemples où un hôte DMZ pourrait être exigé :";
var haf_dmz_60 =" Un hôte peut supporter plusieurs applications qui pourraient nécessiter des ports d'entrée se chevauchant. Alors les deux règles de réacheminement de ports ne peuvent pas être employées parce qu'elles seraient potentiellement en conflit.";
var haf_dmz_70 =" Prendre en charge les connexions entrantes utilisant un protocole autre que ICMP (quand ces protocoles sont permis par les ALGs PPTP et IPSec).";
var help166 ="Le fait de placer un ordinateur dans une zone DMZ l'expose à divers risques liés à la sécurité. Utilisez cette option uniquement si elle est recommandée en dernier recours.";
var help32 =" Ici vous pouvez activer ou désactiver les ALGs. Quelques protocoles et applications exigent une manipulation spéciale de la charge utile d'IP pour les rendre compatibles avec (NAT). Chaque ALG fournit une manipulation spéciale pour un protocole ou une application spécifique. Un certain nombre d’ALGs pour des applications connues sont activés par défaut.";
var help33 =" Permet à de multiple machines du réseau local de se connecter à leurs réseaux d’entreprise en utilisant le protocole PPTP.";
var help34 =" Permet à de multiples clients VPN de se connecter à leurs réseaux d’entreprise en utilisant IPSec. Certains clients VPN permettent d’utiliser IPSec à travers NAT. Cette option peut empêcher l’utilisation de certains clients VPN. Si vous ne pouvez vous connecter au réseau de votre entreprise, essayez de désactiver cette option.";
var help35 =" Vérifier avec l'adminstrateur système de votre réseau d’entreprise si votre client VPN permet de traverser NAT.";
var help34b =" Notez que les connexions VPN L2TP utilisent typiquement l’IPSec pour protéger le lien. Pour permettre de multiples VPN à travers NAT il est nécessaire d’activer l’ALG IPSec.";
var help36 =" Permet aux applications qui utilisent le protocole de diffusion en temps réel de recevoir des médias en continu d'Internet. QuickTime et Real Player sont certaines des applications communes qui utilisent ce protocole.";
var help37 =" Supporte l’utilisation sur les ordinateurs du réseau local de Microsoft Windows Messenger et MSN Messenger. L’ALG SIP doit également être activé quand l’ALG Windows Messenger est activé.";
var as_NM =" H.323 (Netmeeting)";
var help40 =" Permet aux dispositifs et applications utilisant la VoIP (Voix au-dessus d’IP) de communiquer à travers NAT. Quelques applications et dispositifs de VoIP ont la capacité de découvrir les dispositifs NAT et de travailler autour d’eux. Cet ALG peut interférer le fonctionnement de ces dispositifs. Si vous ne pouvez faire des appels VoIP, essayez de désactiver cet ALG.";
var help43 =" Permet à Windows Media Player, en utilisant le protocole MMS, de recevoir des transmissions multimédias en continu d'Internet.";
var help168a =" Quand vous utilisez le Serveur Virtuel, le réacheminement de port, ou les dispositifs d'administration à distance pour ouvrir les ports spécifiques pour communiquer de l'Internet, vous augmentez l'exposition de votre réseau local aux cyberattaques de l'Internet.";
var help168c =" Dans ces cas là, vous pouvez utiliser les filtres entrants pour limiter cette exposition en indiquant les adresses IP des hôtes Internet auxquels vous faites confiance pour accéder à votre réseau local par l’intermédiaire des ports que vous avez ouverts. Vous pourriez, par exemple, permettre seulement l'accès à un serveur de jeu sur votre réseau local à la maison aux ordinateurs des amis que vous avez invités à jouer sur ce serveur.";
var help169 =" Des filtres entrants peuvent être utilisés pour limiter l'accès d’un serveur sur votre réseau à un système ou à un groupe de systèmes. Des règles de filtre peuvent être employées avec le Serveur Virtuel, le jeu, ou les dispositifs d'administration à distance. Chaque filtre peut être utilisé pour plusieurs fonctions ; par exemple un filtre \" Clan de jeu \" pourrait permettre à tous les membres d'un groupe de jeu particulier de jouer plusieurs jeux différents pour lesquels des entrées de jeu ont été créées. En même temps un filtre \"Admin\" permet seulement à des systèmes de votre réseau de bureau d'accéder aux pages de WAN admin et un serveur FTP que vous utilisez à la maison. Si vous ajoutez une adresse IP à un filtre, le changement est effectué à tous les endroits où le filtre est utilisé.";
var help171 =" Ici vous pouvez ajouter des entrées à la liste des règles de filtres entrants ci-dessous ou éditer les entrées existantes.";
var help172 ="Nommez la règle de façon significative.";
var help173 ="La règle peut autoriser ou refuser les messages.";
var help174 =" Définissez la plage des adresses Internet à laquelle cette règle s’applique. Pour une unique adresse IP, saisissez la même adresse dans les deux boîtes <span class=\"option\"> de début </span> et <span class=\"option\"> de fin </span>. Jusqu'à huit plages peuvent être entrées. La case à cocher <span class=\"option\"> Activer </span> vous permet d’activer ou de désactiver des entrées spécifiques dans la liste des plages.";
var help177 =" En plus des filtres listés ici, deux filtres prédéfinis sont disponibles partout où des filtres entrants peuvent être appliqués :";
var help178 ="Autoriser n'importe quel utilisateur du réseau étendu à accéder à la fonction apparentée.";
var help179 =" Empêchez tous les utilisateurs du WAN d'accéder à ces possibilitées. (Les utilisateurs du réseau local ne sont pas affectés par des règles de filtre entrant.)";
var help187 =" Normalement l'émetteur sans fil fonctionne 100% de puissance. Dans certaines circonstances, cependant, il peut être nécessaire d’isoler des fréquences spécifiques dans un plus petit secteur. En réduisant la puissance de la radio, vous pouvez empêcher des transmissions d’aller au delà de la limite de votre bureau /maison ou du secteur sans fil indiqué.";
var help184 =" Les balises sont des paquets envoyés par un routeur sans fil pour synchroniser les dispositifs sans fil. Indiquez une valeur d’Intervalle de balise entre 20 et 1000. La valeur par défaut est réglée à 100 millisecondes.";
var help183 =" sont recommandées.";
var help181 ="Une valeur de fragmentation trop faible risque de diminuer les performances.";
var help185 =" Un DTIM est un compte à rebours informant les clients la prochaine fenêtre pour écouter les messages de multidiffusion. Quand le routeur sans fil a mis en mémoire des messages de multidiffusion pour les clients associés, il envoie le prochain DTIM avec une valeur d'intervalle de DTIM. Les clients sans fil détectent les balises et se réveillent pour recevoir l'émission de multidiffusion. La valeur par défaut est 1. Les réglages valides sont entre 1 et 255.";
var help186 =" Activez l'opération 802.11d. 802.11d est une spécification sans fil s’appliquant pour dans des domaines de normalisation supplémentaires. Ce supplément aux spécifications 802.11 définit les conditions de couche physique (découpage en canaux, canaux virtuels indépendants et sans interférence, nouvelles valeurs pour des attributs MIB actuels, et d’autres conditions d’extension du WLAN 802.11 aux nouveaux domaines de normalisation (pays). Ce supplément ajoute les conditions et les définitions nécessaires pour permettre à l’équipement WLAN 802.11 de fonctionner sur les marchés non servis par la norme actuelle. Activez cette option si vous opérez dans un de ces \" domaines de normalisation supplémentaire \".";
var help188_wmm =" L’activation du WMM peut aider à contrôler la latence et le vacillement lors de la transmission d’un contenu multimédia par une connexion sans fil.";
var aw_sgi_h1 =" L’utilisation d’un intervalle de protection court (400ns) peut augmenter le débit. Cependant, elle peut également augmenter le taux d'erreur, en augmentant la sensibilité aux réflexions des fréquences radio.";
