var help349 =" La section sans fil est employée pour configurer les paramètres sans fil sur votre routeur D-Link. Notez que tous les changements faits dans cette section doivent être reproduits sur les clients sans fil que vous voulez relier à votre réseau sans fil.";
var help351 =" Cette option active et désactive le dispositif de connexion sans fil du routeur. Quand vous réglez cette option, les paramètres suivants sont effectifs.";
var help352 =" Quand vous êtes en train de rechercher les réseaux sans fil disponibles, c'est le nom qui apparaîtra dans la liste (à moins que le statut de visibilité soit réglé sur Invisible, voyez ci-dessous). Ce nom est aussi appelé SSID. Pour plus de sécurité, il est fortement recommandé de changer le nom de réseau préconfiguré.";
var help354 =" Si vous choisissez cette option, le routeur trouve automatiquement le canal avec le moins d’interférence et utilise ce canal pour la gestion de réseau sans fil. Si vous désactivez cette option, le routeur utilise le canal que vous indiquez dans l’option <span class=\"option\">Canal sans fil </span>.";
var help355 =" Un réseau sans fil utilise des canaux spécifiques dans le spectre sans fil pour gérer la communication entre les clients. Certains canaux autour de vous peuvent interférer avec d’autres dispositifs électroniques. Choisissez le canal le plus libre pour aider à optimiser la performance et la couverture de votre réseau sans fil.";
var help357 =" Si tous les dispositifs sans fil que vous voulez connecter à ce routeur peuvent utiliser un même mode de transmission, vous pouvez améliorer légèrement les performances en choisissant le mode \"Seulement\" approprié. Si vous avez certains dispositifs qui utilisent un mode de transmission différent, choisissez le mode \"Mixte\" approprié.";
