var help353 =" L'option invisible vous permet de cacher votre réseau sans fil. Quand cette option est réglée à Visible, votre nom de réseau sans fil est émis à tous ceux présent dans l’étendue de votre signal. Si vous n'employez pas le chiffrement alors ils pourraient se relier à votre réseau. Quand le mode invisible est activé, vous devez saisir le nom de réseau sans fil (SSID) manuellement sur le client pour se relier au réseau.";
var bws_SM_h1 =" À moins qu'un de ces modes de chiffrement soit choisi, des transmissions sans fil vers et à partir de votre réseau sans fil peuvent être facilement interceptées et interprétées par des utilisateurs non autorisés.";
