var help373 ="Ces deux options sont des variantes de l'accès protégé Wi-FI (WPA), des normes de sécurité publiées par l'Alliance Wi-Fi. Le <span class=\"option\">Mode WPA</span> perfectionne davantage la variante que le routeur doit employer.";
