var help381 =" Clé pré-partagée :";
var help382 =" La clé est saisie comme une phrase d’un maximum de 63 caractères alphanumériques dans le format ASCII (American Standard Code for Information Interchange) aux deux extrémités du raccordement sans fil. Elle ne peut pas être plus courte que huit caractères, bien que pour une meilleure sécurité, elle doit atteindre une longueur suffisante et ne devrait pas être une phase généralement connue. Cette phase est employée pour générer des clés de session qui sont uniques pour chaque client sans fil.";
