var help397 =" Cette option active la configuration d'un serveur de secours RADIUS facultatif. Le  serveur de secours RADIUS peut être utilisé comme une copie du serveur primaire RADIUS. Le serveur de secours RADIUS est consulté seulement si le serveur primaire n'est pas disponible ou ne répond pas.Les champs <span class=\"option\">Adresse IP du serveur de secours RADIUS</span>,<span class=\"option\"> Port du serveur RADIUS </span>,<span class=\"option\"> Secret partagé du serveur de secours RADIUS </span>,<span class=\"option\"> Authentication de l’adresse MAC secondaire </span> fournissent les paramètres correspondants pour le serveur de secours RADIUS.";
var help254 =" La section WAN (de réseau étendu) vous permez de configurer votre type de connexion à Internet.";
var help254_ict =" Il y a plusieurs types de connexion: IP statique, DHCP, PPPoE, PPTP, et L2TP. Si vous n’êtes pas sûr sur votre méthode de connexion, consultez votre Fournisseur d’Accès à Internet. Remarque : Lorsque vous utilisez l'option PPPoE, vous devez vous assurer que tous les logiciels client PPPoE sur vos ordinateurs sont supprimés ou désactivés.";
