var help259 ="Méthode de connexion dans laquelle votre FAI vous attribue une adresse IP quand le routeur en fait la demande au serveur du FAI. Certains FAI vous demandent de configurer quelques paramètres de votre côté pour que votre routeur puisse se connecter à Internet.";
var help260 =" Nom d'hôte :";
var help261 =" Certains FAI peuvent vérifier le nom d'hôte de votre ordinateur. Le nom d'hôte identifie votre système sur le serveur du FAI. De cette façon, ils savent que votre ordinateur est autorisé à recevoir une adresse IP. En d'autres termes, ils savent que vous payez pour leur service.";
var help261a ="Cette option est normalement désactivée et doit le rester tant que le serveur DHCP du réseau étendu fournit correctement une adresse IP au routeur. Toutefois, si le routeur ne peut pas obtenir une adresse IP du serveur DHCP, il est possible que ce dernier fonctionne mieux avec des réponses de diffusion individuelle. Dans ce cas, activez l'option de diffusion individuelle et observez si le routeur peut obtenir une adresse IP. Dans ce mode, le routeur accepte des réponses de diffusion individuelle du serveur DHCP à la place de réponses de multidiffusion.";
var help262 =" Activez BigPond:";
