var help278 =" PPTP (Point to Point Tunneling Protocol) utilisee un réseau privé virtuel pour se connecter à votre FAI. Cette méthode de connexion est principalement employée en Europe. Elle exige de saisir un <span class=\"option\"> Nom d’utilisateur </span> et <span class=\"option\"> Mot de passe </span> (fourni par votre FAI) pour accéder à Internet.";
