var help290a =" Saisissez les adresses IP des serveurs DNS. Laissez le champ pour le serveur secondaire vide si vous l’utilisez pas.";
var help293 =" MTU:";
var help294 =" L’Unité de transmission maximum(MTU) est un paramètre qui détermine la taille maximum des paquets (en octets) que le routeur enverra au WAN. Si les machines du LAN envoient de plus grands paquets, le routeur les fragmentera en plus petits paquets. Idéalement, vous devriez appliquer la valeur utilisée par votre FAI. Les valeurs typiques sont 1500 octets pour une connexion Ethernet et 1492 octets pour une connexion PPPoE. Si la MTU du routeur est réglée trop haute, des paquets seront fragmentés dans le sens descendant. Si elle est réglée trop basse, le routeur fragmentera des paquets inutilement et voir même ne pourra pas établir certaines connexions. Dans tous les cas, la performance de réseau peut en souffrir.";
var help303 =" Adresse MAC:";
var help302 =" Chaque adaptateur réseau possède son adresse MAC unique définie par le fabricant du matériel. Quelques FAI peuvent vérifier l’adresse MAC de votre ordinateur. Certains enregistrent l’adresse MAC de l'adapteur réseau de l'ordinateur ou du routeur utilisé pour se connecter initialement à leur service. Le FAI n’autorise alors l'accès d'Internet qu’à l’équippement ayant cette adresse MAC. Votre routeur a une adresse MAC différente que celle de l'ordinateur ou du routeur qui s’est reliée initialement à votre FAI.";
var help304 =" Si vous devez changer l’adresse MAC de l'interface Ethernet WAN du routeur, et saisir une adresse MAC alternative (par exemple, l’adresse MAC du routeur qui s’est relié initialement à votre FAI) ou copier l’adresse MAC d'un PC. Pour copier l’adresse MAC de l'ordinateur qui s'est déjà reliée au FAI, connectez-vous au routeur D-Link à l'aide de cet ordinateur et appuyez sur le bouton <span class=\"button_ref\"> Copier l’adresse MAC de votre PC</span>. L'interface WAN emploiera alors l’adresse MAC de l'adapteur réseau de cet ordinateur.";
var help305 =" Ce sont les réglages de l'interface LAN (réseau local) du routeur. L’adresse IP et le masque de sous-réseau. Cette adresse IP est également utilisée pour accéder à l’interface de gestion du routeur.";
var help305rt =" Il est recommandé d’employer les réglages par défaut si vous n'avez pas de réseau existant.";
var help307 =" L'adresse IP de votre routeur sur le réseau local. Vos réglages de réseau local sont basés sur l'adresse assignée ici. Par exemple 192.168.0.1.";
var help309 =" La masque de sous-réseau de votre routeur sur le réseau local.";
var num_1044 =" Cette entrée est facultative. Saisissez un nom de domaine pour le réseau local. Le serveur DHCP de l’AP donnera ce nom de domaine aux ordinateurs sur le réseau local sans fil. Donc, par exemple, si vous entrez <code>mynetwork.net</code> ici, et vous avez un ordinateur sans fil avec le nom de <code> chris</code>, cet ordinateur sera considéré comme <code>chris.mynetwork.net</code>.";
var bln_title_DNSRly ="Relais DNS";
var help312dr2 ="Quand l'option Relais DNS est activée, le routeur joue le rôle d'un serveur DNS. Les demandes DNS envoyées au routeur sont redirigées vers le serveur DNS du FAI. Ceci fournit une adresse DNS constante que les ordinateurs du réseau local peuvent utiliser, même si le routeur obtient une autre adresse de serveur DNS de la part du FAI lors du rétablissement de la connexion de réseau étendu. Vous devez désactiver cette option si vous mettez en oeuvre un serveur DNS de réseau local en tant que serveur virtuel.";
var help314 =" DHCP est le protocole de configuration dynamique d’Hôte. La section DHCP vous permet de configurez le serveur DHCP intégré pour assigner des adresses IP aux ordinateurs et aux autres dispositifs sur votre réseau local (LAN).";
var help316 =" Une fois que votre routeur D-Link est correctement configuré et cette option est activée, le serveur DHCP contrôlera les adresses IP et tous les autres informations de configuration de réseau pour les ordinateurs et les autres dispositifs reliés à votre réseau local. Il n’est plus nécessaire de le faire par vous-même.";
var help317 ="Les paramètres TCP/IP des ordinateurs (et des autres périphériques) connectés à votre réseau local doivent également être configurés sur \"DHCP\" ou sur \"Obtenir une adresse IP automatiquement\".";
var help318 =" Lorsque vous réglez <span class=\"option\"> Activez le serveur DHCP </span>, les options suivantes apparaissent.";
var help319 =" Ces deux valeurs d'IP (<i>de </i> et <i>à </i>) définissent une plage d’adresses IP que le serveur DHCP emploie lorsqu’il l’assigne aux ordinateurs et aux dispositifs de votre réseau local. Toutes les adresses en dehors de cette étendue ne sont pas contrôlées par le serveur DHCP ; elles peuvent donc être employées pour configurer manuellement des dispositifs ou pour des dispositifs qui ne peuvent pas employer de client DHCP automatique.";
var help321 =" Votre routeur D-Link à par défaut l’adresse IP statique 192.168.0.1. Ceci signifie que les adresses de 192.168.0.2 à 192.168.0.254 sont disponibles pour l'attribution par le serveur DHCP.";
var help322 =" L’adresse IP de votre routeur D-Link est 192.168.0.1. Vous avez un ordinateur que vous voulez utiliser comme serveur Web avec une adresse IP statique 192.168.0.3. Un autre ordinateur que vous voulez utiliser comme serveur FTP avec une adresse IP statique 192.168.0.4. Par conséquent la plage d'adresse IP DHCP doit commencer par 192.168.0.5 ou supérieure.";
var help323 =" Supposez que vous configurez le serveur DHCP sur la plage d’adresses 192.168.0.100 - 192.168.0.199. Ceci signifie que 192.168.0.3 à 192.168.0.99 et 192.168.0.200 à 192.168.0.254 ne sont pas contrôlées par le serveur DHCP. Des ordinateurs ou des dispositifs avec des adresses dans ces plages doivent être configurés manuellement. Supposez que vous avez un serveur web qui a une adresse manuellement configurée de 192.168.0.100. Puisque cette adresse IP est dans ‘la plage contrôlée’ faites une réservation pour cette adresse et activez la(voir ci-dessous <a href=\"#Static_DHCP\">Static DHCP Client</a>).";
var help324 ="Durée pendant laquelle un ordinateur bénéficie d'une adresse IP avant de devoir en renouveler la concession. La concession fonctionne exactement comme le bail de location d'un appartement. La concession initiale désigne la durée avant expiration de la concession. Si le bénéficiaire de la concession souhaite conserver l'adresse après l'expiration de la concession, alors une nouvelle concession est établie. Si la concession expire et que son bénéficiaire n'a plus besoin de l'adresse, alors celle-ci peut être concédée à une autre personne.";
var help325 ="Toujours diffuser";
var help326 =" Si tous les ordinateurs sur le réseau local obtiennent avec succès leurs adresses IP du serveur DHCP du routeur, cette option peut rester désactivée. Cependant, si un des ordinateurs sur le réseau local n'obtient pas une adresse IP du serveur DHCP du routeur, il peut avoir un ancien client DHCP. L’activation de cette option pourra régler ce problème, mais augmentera le trafic de diffusion sur le réseau local.";
var help330 =" Ajouter/Editer une réservation DHCP";
var help331 =" Cette option vous permet de réserver des adresses IP, et d’assigner la même adresse IP au dispositif réseau avec l’adresse MAC indiquée quand elle la demande. C'est presque identique à configurer une adresse IP statique sauf que le dispositif doit demander une adresse IP au routeur D-Link. Le routeur D-Link fournira chaque fois la même adresse IP au dispositif. Les réservations DHCP sont utiles pour les ordinateurs serveur sur le réseau local qui hébergent des applications telles que le Web et le FTP. Les serveurs sur votre réseau devraient employer une adresse IP statique ou employer cette option.";
var help345 ="Vous pouvez donner un nom à chaque ordinateur possédant une adresse IP réservée. Ceci peut vous aider à conserver la trace des ordinateurs dont l'adresse IP a été attribuée de cette façon.";
var help346 =" Serveur de jeu";
var num_1066 ="Adresse de réseau local que vous voulez réserver.";
var help333 =" Pour saisir l'adresse MAC de votre système, veuillez la saisir manuellement ou vous relier à l'interface Web-Gestion du routeur D-Link du système et appuyez sur le bouton <span class=\"button_ref\"> Copiez l’ adresse MAC de votre PC </span> .";
var help334 =" Une adresse MAC est habituellement située sur une étiquette sur l’adaptateur réseau. L’adresse MAC est composée de douze chiffres. Chaque paire de chiffres hexadécimaux est généralement séparée par des tirets ou des deux-points tels que 00-0D-88-11-22-33 ou 00:0D:88:11:22:33. Si la carte réseau est dans votre ordinateur, vous pouvez vous connecter au routeur D-Linkà partir de cet ordinateur et appuyez sur le bouton <span class=\"button_ref\"> Copiez l’adresse MAC de votre PC </span> pour saisir l’adresse MAC.";
var help335 ="Une autre solution consiste à localiser une adresse MAC dans un système d'exploitation spécifique en suivante les étapes ci-après :";
var help336 ="Windows 98";
var help337 ="Windows Me";
var help338 ="Dans le menu Démarrer, sélectionnez Exécuter, tapez <code>winipcfg</code>, puis appuyez sur la touche Entrée. Une fenêtre s'affiche. Sélectionnez la carte appropriée dans le menu déroulant ; vous obtiendrez ainsi l'adresse de la carte. Il s'agit de l'adresse MAC du périphérique.";
var help339 ="Windows 2000";
var help340 ="Windows XP";
var help341 =" Allez dans votre menu Démarrer, sélectionnez Tous les programmes, sélectionnez Accessoires, et sélectionnez Invite de commandes. Dans cette fenêtre, saisissez <code> ipconfig /all </code> et frappez la touche Retour. L'adresse physique affichée est l’adresse MAC.";
var help342 ="Mac OS X";
var help343 =" Allez au Menu Apple, sélectionnez Préférence système, sélectionnez Réseau, puis sélectionnez l'adapteur d'Ethernet connecté au routeur D-Link. Sélectionnez le bouton Ethernet et l'identification d'Ethernet sera indiquée. Il s’agit de l’adresse MAC.";
var help348 =" Ceci montre les clients que vous avez spécifiés pour avoir des adresses réservées DHCP. Une entrée peut être changée en cliquant l'icône Editer, ou être supprimée en cliquant l'icône Supprimer. Quand vous cliquez l'icône Editer, l'article est surligné, et la section ‘Editer la réservation DHCP’ est activée pour l'édition.";
var help327 =" Dans cette section vous pouvez voir quels dispositifs du LAN louent actuellement des adresses IP dynamiques.";
var help329 =" L'option <code>Annuler</code> est disponible si la table de location devient pleine ou presque pleine, et que vous deviez récupérer de l'espace dans cette table pour de nouvelles entrées, sachant que certaines des assignations actuelles ne sont plus nécessaires. Appuyez sur <code>Révoquer </code> annule le bail pour un dispositif spécifique du réseau local et libère une entrée dans le tableau de location. Faites ceci seulement si le dispositif n'a plus besoin de l’adresse IP louée, par exemple, s’il n’existe plus sur le réseau.";
var help329_rsv =" L'option <code>Réserver </code> convertit cette attribution dynamique d'IP en réservation DHCP et ajoute l'entrée correspondante à la liste de réservations DHCP.";
