var help772 =" Tous vos détails de connexions Internet et de réseau sont affichés sur la page d’info du dispositif. La version du logiciel est également affichée ici.";
var help773 ="Remarque : Certains navigateurs présentent certaines limitations qui rendent impossible toute actualisation de l'affichage de l'état du réseau étendu quand l'état change. Dan ce cas, c'est à vous d'actualiser l'affichage pour obtenir l'état mis à jour. En outre, certains navigateurs signalent une condition d'erreur quand vous essayez d'obtenir l'état du réseau étendu.";
var help774 ="Selon le type de connexion au réseau étendu, vous pouvez prendre l'une des mesures suivantes :";
var help775 ="Connexion DHCP";
var help776 =" Appuyez sur le bouton  <span class=\"button_ref\"> Mise à jour DHCP </span> pour ignorer l' adresse IP du routeur. Le routeur ne répondra plus aux messages IP du WAN jusqu'à ce que vous cliquiez sur le bouton <span class=\"button_ref\"> Remplacement DHCP </span> ou que vous mettiez de nouveau le routeur sous tension. Appuyez sur le bouton <span class=\"button_ref\"> Remplacement DHCP </span> implique que le routeur demande une nouvelle adresse IP au serveur du FAI.";
var help777 ="Connexions PPPoE, PPTP et L2TP";
var help778 ="En fonction de la connexion au réseau étendu actuellement établie, vous pouvez cliquer sur le bouton <span class=\"button_ref\">Connecter</span> pour essayer d'établir la connexion au réseau étendu ou sur le bouton <span class=\"button_ref\">Déconnecter</span> pour interrompre la connexion au réseau étendu.";
var help779 ="Connexion BigPond";
var help780 ="Selon que vous soyez ou non actuellement connecté à BigPond, vous pouvez cliquer sur le bouton <span class=\"button_ref\">Connexion BigPond</span> pour essayer d'établir la connexion au réseau étendu ou sur le bouton <span class=\"button_ref\">Déconnexion BigPond</span> pour interrompre la connexion au réseau étendu.";
var _LANComputers ="Ordinateurs du réseau local";
var help781 =" Cette partie d'écran est mise à jour continuellement pour afficher tous les ordinateurs et dispositifs clients DHCP qui sont reliés au LAN du routeur. La ‘plage’ de détection est limitée à la plage d'adresses configurée dans le serveur DHCP. Les ordinateurs qui ont une adresse en dehors de cette plage ne seront pas vus. Si le client DHCP (c.-à-d. un ordinateur configuré pour obtenir automatiquement une adresse) fournit un nom d'hôte, alors il sera également affiché. Tout ordinateur ou dispositif avec une adresse IP statique comprise dans la \"plage\" de détection peut être listé, mais pas son nom d'hôte.";
