var ADV_DNS_DESC1 ="DNS est l'acronyme de Domaine Name System (système de noms de domaine). Les serveurs DNS jouent un rôle d'annuaire et traduisent le nom de domaine compréhensible par l'homme en adresse IP correspondante. La fonction Advanced DNS Services (Services DNS avancés) de D-Link est proposée par Best Path Networks, une filiale d'OpenDNS qui fournit des services contre la fraude et DNS à ses partenaires, notamment D-Link. OpenDNS est le leader international à la croissance galopante des services de sécurité et d'infrastructure DNS gratuits. La fonction Advanced DNS Services sécurise votre navigation en ligne et votre Internet est globalement plus rapide et plus fiable.";
var ADV_DNS_DESC2 ="La plateforme DNS est conçue pour ne pas interférer avec des protocoles spécifiques. Cependant, un petit groupe de solutions de filtrage des spams peut être perturbé lorsqu'il reçoit des réponses de recherche de domaines qui n'existent pas. Il est donc conseillé de désactiver la fonction de recherche avancée pour les clients utilisant un serveur de messagerie sur site. Le DNS n'a aucun effet sur les vitesses de chargement ascendant et descendant. Ces dernières sont en effet contrôlées à 100 % par votre fournisseur d'accès Internet. D-Link et Best Path Networks ne recueillent et ne conservent aucune information DNS permettant d'identifier personnellement les utilisateurs d'Advanced DNS Services.";
var ADV_DNS_DESC3 ="Vos résultats de recherche sont générés par Yahoo. La fonction de recherche vous permet de fluidifier considérablement votre navigation. Lorsqu'un site est inaccessible ou inexistant, nous émettons des suggestions de recherche plutôt que de laisser votre navigateur afficher un message d'erreur général. Nous corrigeons également automatiquement certaines fautes d'orthographe courantes introduites par l'utilisateur dans la barre d'adresse. La fonction de correction orthographique ne fonctionne que pour les domaines très connus (par ex. .cmo et .ogr). Vous serez peut-être parfois redirigés vers une page de résultats de recherche inappropriée. Si vous avez cliqué sur un lien contenu dans un spam, il est possible que le site ait été désactivé pour cause d'abus. Ce site n'existant plus, vous recevrez peut-être notre page de recherche.";
